        async function clickProcess(ev) {
            ev.stopPropagation();
            ev.preventDefault();
            const form = document.getElementById("form");
            await runSpin();

            const valores = Object.fromEntries(
                new FormData(form)
            );

            const errors = await validationForm(valores);
            if (errors != "") {
                alert(errors);
                await stopSpin();
                return false;
            }

            const workbook = await fileToWorkbook(valores["file"]);
            if (!workbook) {
                alert("Error de formato archivo excel o fallo conexion a internet");
                await stopSpin();
                return false;
            }
            const jsonData = await workbookToJson(workbook);
            if (!jsonData) {
                alert("Error de formato archivo excel");
                await stopSpin();
                return false;
            }
            await createPDF(jsonData, valores);
            setTimeout(async () => {
                await stopSpin();
            }, 3500);

        }

        async function runSpin() {
            let spin = document.getElementById("spin");
            let textButtonProcess = document.getElementById("textButtonProcess");
            let buttonProcess = document.getElementById("botonprocesar");
            let loader = document.getElementById("loader");

            spin.className = "fa fa-spinner fa-spin";
            buttonProcess.disabled = true;
            textButtonProcess.textContent = "PROCESANDO....";
            loader.className = "loader";
        }

        async function stopSpin() {
            let spin = document.getElementById("spin");
            let textButtonProcess = document.getElementById("textButtonProcess");
            let buttonProcess = document.getElementById("botonprocesar");
            let loader = document.getElementById("loader");
            spin.className = "";
            loader.className = "";
            buttonProcess.disabled = false;
            textButtonProcess.textContent = "Procesar";
        }

        async function setFontsToPDF(doc, regular, bold) {
            doc.addFileToVFS('LiberationSerif-Regular-normal.ttf', regular);
            doc.addFont('LiberationSerif-Regular-normal.ttf', 'LiberationSerif-Regular', 'normal');

            doc.addFileToVFS('LiberationSerif-Bold-bold.ttf', bold);
            doc.addFont('LiberationSerif-Bold-bold.ttf', 'LiberationSerif-Bold', 'bold');
        }

        async function drawContorn(doc) {
            doc.setLineWidth(0.01);
            doc.rect(2.1, 1.9, 16.7, 24.5);
            doc.line(10.5, 1.9, 10.5, 26.4);
        }

        async function generateLeft(dataAsociation, doc, positions, currentSocio) {

            // image

            doc.text(dataAsociation.tituloAsocicacion, 4.4, positions.titulo.yL);

            doc.setFontSize(24);
            doc.text(dataAsociation.precio, 8.6, positions.precio.yL);

            // cuota

            doc.setFontSize(17);
            doc.text(dataAsociation.cuota, 2.5, positions.cuota.yL);

            doc.setFontSize(10);

            doc.setFont(dataAsociation.nombreFuentes["liberationRegular"], "normal");
            doc.setFontSize(11);
            let numSocio = currentSocio.socio;
            if (!numSocio) {
                numSocio = "-"
            }
            doc.text(`${fullName.toUpperCase()}\n${dataAsociation.numsocio} ${numSocio}`, 6, positions.socio.yL, { align: 'center', maxWidth: 7 });

        }

        async function getFullName(currentSocio) {
            let fullName = "";
            if (currentSocio.nombre !== "" && currentSocio.nombre !== undefined) {
                fullName += currentSocio.nombre.trim();
            } else {
                fullName += "-";
            }

            if (currentSocio.apellido1 !== "" && currentSocio.apellido1 !== undefined) {
                fullName += ` ${currentSocio.apellido1.trim()}`;
            } else {
                fullName += " ";
            }

            if (currentSocio.apellido2 !== "" && currentSocio.apellido2 !== undefined) {
                fullName += ` ${currentSocio.apellido2.trim()}`;
            } else {
                fullName += " ";
            }

            return fullName;
        }

        async function workbookToJson(workbook) {
            try {
                if (!workbook) {
                    return undefined;
                }
                const sheet = workbook.Sheets[workbook.SheetNames[0]];
                if (!sheet) {
                    return undefined;
                }

                // const data_headers = ["socio","apellido1","apellido2","nombre"];
                const jsonData = XLSX.utils.sheet_to_json(sheet, { header: 0 });
                if (!jsonData) {
                    return undefined;
                }
                jsonData.sort((a, b) => a.apellido1.localeCompare(b.apellido1));
                return jsonData;
            } catch (error) {
                return undefined;
            }
        }

        // read file and send woorkbook
        async function fileToWorkbook(file) {
            try {
                const data = await file.arrayBuffer();
                if (!data) return undefined;
                const workbook = XLSX.read(data);
                if (!workbook) return undefined;
                return workbook;
            }
            catch (error) {
                return undefined;
            }
        }

        // validation form and send errors to alert
        async function validationForm(valores) {
            let errors = "";
            if (!valores["file"] || valores["file"].size <= 0) {
                errors += "Falta el archivo\n";
            }

            if (valores["file"].type !== "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet") {
                errors += "Tipo de archivo incorrecto";
            }

            if (valores["fechaAnyo"] <= 0) {

            // }

            // if (!valores["colfilApellido2"] || valores["colfilApellido2"] == "") {
            //     errors += "Falta columna para el segundo apellido\n";

            // }

            return errors
        }
